Here's an example of a C++ program that reads a text file line by line and counts the number of occurrences of a specific word in the file.
#include <iostream>
#include <fstream>
#include <string>

int main()
{
    std::ifstream inf("text.txt");
    std::string line;
    while (std::getline(inf, line))
    {
        std::string word = line;
        std::size_t count = 0;
        for (std::size_t i = 0; i < word.size(); ++i)
            if (word[i] =='' || word[i] == '\t')
                ++count;
        std::cout << count << " occurrences of " << word << " found in the file." << std::endl;
    }
}
